import "./App.css";
import Header from "./component/layout/Header/Header.js";
import {BrowserRouter as Router} from "react-router-dom";

function App() {
    return (
        <Router>
            <Header />
            <div className="App">
                <img src= {require('.images/ProjetoLogoFetech2.svg')} height={200} width={200} />
            </div>
            <p>Teste</p>
        </Router>
    );
}
export default App;
